content:
작가님이 그린 그림도 잔인하지만
실제로는 더욱 저참하게..;;;
유투브에 보면 일본놈들이 한국인들 작두로 목 자르고
임신한 여인들 저참하게 죽이고 뱃속에 애기를 꺼내서.. 태줄이 붙은채로 죽은;;;

학춘이 보니까 울컥하네요.. 
만화 보고서 울컥하다니;;; 
내가 조선인 핏줄인게 분명함!!!!

원빈의 대사 한마디가 자꾸 맴도네...

&quot;아직 한발 남았다&quot;

장전된 총알 한발 남은건 아니겄제?

으쩌켜........ 너무 아쉽고...짠하고...맘이 시려서... 보고 또 보는디 옥의 티가 보여..ㅠㅠ 몰랑..아 몰랑..ㅠㅠ
박출세가 머물던 초가집...눈 뒤집어쓴 초가집... 눈이 고롷게 쌓여있으면 빗살무늬가 없어야지... 누가 마무리한것이여...ㅠㅠ
한번 보이니께 자꾸 보여서 거슬리요...ㅠㅠ 책으로 낼때는 어떻케 좀 해봐줘요... ^^;;

미나가 도넛 먹으려는 장면에 
&quot;미스터리 썸머워즈 뒷풀이랬어~ 엄청 맛있다~&quot;
라고 나와있는데 내 기억엔 &quot;엄청 먹었다~&quot;
였다... 연굴 정주행 n회는.... 다 기억한다...
